Prerequisite Knowledge: Given any two of the preorder, inorder, and postorder traversals, a unique binary tree can be reconstructed. When we need to reconstruct a binary tree, we can use the inorder and postorder traversal sequences to achieve this. Inorder traversal follows the order of "left subtree - root node - right subtree," and it helps us determine the relative positions of nodes in the tree. Postorder traversal follows the order of "left subtree - right subtree - root node." Therefore, the last node in the postorder traversal sequence is the root node of the tree. Based on these characteristics, we can reconstruct the binary tree recursively using the following steps: Take the last node from the postorder traversal, which becomes the root node of the tree. Find the position of the root node in the inorder traversal, allowing us to determine the number of nodes in the left subtree and the right subtree. Create a tree node and set its weight as the weight of the root node. Divide the inorder traversal using index mapping and recursively process the left subtree and right subtree. Repeat the above steps until all nodes have been processed, and the tree is completely reconstructed. Sample Code int tree(int l, int r, int l2, int r2) { if(r < l) return -1; int root = post[r2]; int rootid = pos[root]; left__[root] = tree(l, rootid-1, l2, l2-l+rootid-1); right__[root] = tree(rootid+1, r, r2-r+rootid, r2-1); return root;
} // Index mapping
