課堂上有教過如何在 O(logy) 的時間內計算 xymodp，這題在 k=1 時，可以直接套用這個方法。 把這題的標題「Binary Exponentiation」放到 Google 搜尋也能找到許多相關的教學文章。 快速冪的具體概念就是將 f(y):=xy 拆成 重複的子問題 遞迴解決，觀察到 f(y)=f(a)⋅f(y−a)： f(y)={f(⌊y/2⌋)⋅f(⌊y/2⌋)f(⌊y/2⌋)⋅f(⌊y/2⌋)⋅f(1)​if y is even,if y is odd.​ 顯然不需要遞迴兩次重複計算一樣的 f(⌊y/2⌋)，所以可以先 將其記錄下來 以便直接取用。 快速冪－遞迴版本 int fpow(int base, int exp, int mod) { if (exp == 0) return 1 % mod; int half = fpow(base, exp/2, mod); // return half * half % mod * (exp & 1 ? base : 1) % mod; if (exp % 2 == 0) return half * half % mod; else /// remember to take mod to reduce the maximum value during calculation /// return half * half % mod * base % mod; /* ^^^^^ */
} 以下再介紹一個不依賴遞迴的實作方式。 這個實作方式利用到了 y 的 二進位表示法 ∑i=0∞​2ibi​，其中 bi​∈{0,1}，這樣就可以將 f(y) 拆成 ∏i=0∞​f(2ibi​)。 在 C++ 可以使用 y & (1 << i) 來取得 bi​，而 y >> i 可以取得 ⌊y/2i⌋。以下範例程式碼的實作方式是不斷將次方項用 >>= 1 除以二之後以 & 1 來取出「個位數」的值。 快速冪－二進制版本 int fpow(int base, int exp, int mod) { int ans = 1 % mod; while (exp) { if (exp & 1) ans = ans * base % mod; exp >>= 1, base = base * base % mod; } return ans;
