In class, we learned how to calculate xymodp in O(logy) time. For the subtask k=1 we can apply this method directly. You can also find many related tutorial articles by searching "Binary Exponentiation" on Google. The concept of binary exponentiation is to break down f(y):=xy into repeated subproblems solved recursively. Observe that f(y)=f(a)⋅f(y−a): f(y)={f(⌊y/2⌋)⋅f(⌊y/2⌋)f(⌊y/2⌋)⋅f(⌊y/2⌋)⋅f(1)​if y is even,if y is odd.​ Obviously, there's no need to recursively compute f(⌊y/2⌋) twice, so it can be stored for direct use. Binary Exponentiation - Recursive Version int fpow(int base, int exp, int mod) { if (exp == 0) return 1 % mod; int half = fpow(base, exp/2, mod); // return half * half % mod * (exp & 1 ? base : 1) % mod; if (exp % 2 == 0) return half * half % mod; else /// remember to take mod to reduce the maximum value during calculation /// return half * half % mod * base % mod; /* ^^^^^ */
} Here's another implementation that doesn't rely on recursion. This implementation utilizes the binary representation of y, given by ∑i=0∞​2ibi​, where bi​∈{0,1}. This way, f(y) can be broken down into ∏i=0∞​f(2ibi​). In C++, you can use y & (1 << i) to obtain bi​, and y >> i to get ⌊y/2i⌋. The example code continuously divides the exponent term by 2 using >>= 1 and extracts the "unit digit" value using & 1. Binary Exponentiation - Binary Version int fpow(int base, int exp, int mod) { int ans = 1 % mod; while (exp) { if (exp & 1) ans = ans * base % mod; exp >>= 1, base = base * base % mod; } return ans;
}

