想像你現在想找到左界 ℓ 在 [L0​,L1​] 之間、右界 r 在 [R0​,R1​] 之間的所有區間的答案（[L0​,L1​] 跟 [R0​,R1​] 沒有交集）： 如果算式變成 r−ℓ=k 要怎麼做，能不能在 O(R1​−L0​) 做完？ 作法 簡單嘛，枚舉 ℓ∈[L0​,L1​]，檢查 ℓ+k 有沒有落在 [R0​,R1​] 就好了～ 如果算式變成 maxℓ,L1​​−(r−ℓ)=k 要怎麼做？ 作法 先把式子跟 ℓ、r 有關的分開，得到 maxℓ,L1​​+ℓ−k=r 對一個 ℓ∈[L0​,L1​] 而言，定義 costL​(ℓ)=maxℓ,L1​​+ℓ，只要 costL​(ℓ)−k 落在 [R0​,R1​] 就有一組解。 而 costL​(ℓ) 可以透過紀錄 a 從 L1​ 往前的最大值來做到 O(1) 維護。 Sample Code int solve(int L0, int L1, int R0, int R1) { int ans = 0; for (int l = L1, mx = a[L1]; l >= L0; --l) { mx = max(mx, a[l]); if (R0 <= mx + l - k and mx + l - k <= R1) ++ans; } return ans;
} 如果算式變成 (maxℓ,L1​​−minR0​,r​)−(r−ℓ)=k 要怎麼做？ 作法 一樣把式子整理到兩邊，變成 maxℓ,L1​​+ℓ−k=minR0​,r​+r 右式雖然 不再是一個區間 ，但我們還是能透過先計算出所有合法的右界 costR​(r):=minR0​,r​+r 之後，再枚舉 ℓ 來找到答案。 需要特別注意的是 costR​ 中可能會有 重複 的數字（e.g., [4,2,3,1] 的 costR​(1)=costR​(3)=costR​(4)=5），此時，我們也需要 多次 計算到這些右界帶來的貢獻。 以下的實作方式是使用 std::map 來記錄 costR​ 裡的所有數字跟出現次數，在從 L1​ 到 L0​ 遍歷 ℓ 時便可以直接計算答案。 Sample Code int solve(int L0, int L1, int R0, int R1) { int ans = 0; map<int, int> costR; for (int r = R0, mn = a[R0]; r <= R1; ++r) { mn = min(mn, a[r]); ++costR[mn + r]; } for (int l = L1, mx = a[L1]; l >= L0; --l) { mx = max(mx, a[l]); ans += costR[mx + l - k]; } return ans;
} 如果算式變成 max(maxℓ,L1​​,maxR0​,r​)−(r−ℓ)=k 要怎麼做？ 作法 一樣把式子整理到兩邊...... 咦？好像整理不了了耶 QwQ 那能不能試著 分開討論 可能會出現的 case 啊？ maxℓ,L1​​>maxR0​,r​：最大值出現在 [ℓ,L1​] 裡面； maxℓ,L1​​<maxR0​,r​：最大值出現在 [R0​,r] 裡面； maxℓ,L1​​=maxR0​,r​：兩邊都有最大值！？ 還是先考慮 a 是 1,2,…,n 的排列好了...... (1.) 跟 (2.) 本質上是相同的，只是左右對調而已，以下說明只講解 (1.) 的部分。 如果我們希望讓最大值出現在 [ℓ,L1​]，那就代表此時的 r 不能太大 ，不然可能會把一個超過 maxℓ,L1​​ 的數字加進右半邊。 但這樣對不同的 ℓ 都會有不同的 r 範圍，要怎麼做到快速的維護呢？ 考慮到當你把 ℓ 往左移一步的時候 maxℓ−1,L1​​=max(aℓ−1​,maxℓ,L1​​) 一定只會變大，所以隨著 ℓ 往 L0​ 移動，合法的 r 的 右界 一定也只會 往 R1​ 靠近 （左界一定固定在 R0​）。 於是，我們可以使用 two-pointer 來維護：用兩個變數分別記錄當前的左右界 (ℓ,r)，並在每次移動 ℓ 的時候都使用 while 迴圈檢查 r 能往右移動到哪裡。 既然我們已經知道最大值出現在 [ℓ,L1​] 裡面，那我們就可以把式子整理成第二個提示中的算式： maxℓ,L1​​+ℓ−k=r 剩下的實作部分請參考 code。 Sample Code int solve(int L0, int L1, int R0, int R1) { int ans = 0; for (int l = L1, r = R0-1, mx = a[L1]; l >= L0; --l) { mx = max(mx, a[l]); while (r < R1 and a[r+1] < mx) ++r; if (R0 <= mx + l - k and mx + l - k <= r) ++ans; } for (int l = L1+1, r = R0, mx = a[R0]; r <= R1; ++r) { mx = max(mx, a[r]); while (l > L0 and a[l-1] < mx) --l; if (l <= -mx + r + k and -mx + r + k <= L1) ++ans; } return ans;
} 如果算式變回原本那樣要怎麼做？ 作法 先忽略 (L1​,R0​) 範圍的東西。也就是說，我們現在要找到所有 (ℓ,r) pair 使得 (max(maxℓ,L1​​,maxR0​,r​)−min(minℓ,L1​​,minR0​,r​))−(r−ℓ)=k 繼續分 case： maxℓ,L1​​>maxR0​,r​ 且 minℓ,L1​​<minR0​,r​：最大跟最小值都出現在 [ℓ,L1​] 裡面； maxℓ,L1​​<maxR0​,r​ 且 minℓ,L1​​>minR0​,r​：最大跟最小值都出現在 [R0​,r] 裡面； maxℓ,L1​​>maxR0​,r​ 且 minℓ,L1​​>minR0​,r​：最大值在左邊、最小值在右邊； maxℓ,L1​​<maxR0​,r​ 且 minℓ,L1​​<minR0​,r​：最大值在右邊、最小值在左邊。 因為對稱性，以下只分析 (1.) 跟 (3.) 的 case： 在 (1.) 最大最小值都出現在 [ℓ,L1​] 的時候，我們可以得出跟上一個提示一樣的性質： 隨著 ℓ 往 L0​ 移動，合法的 r 的 右界 一定也只會 往 R1​ 靠近 （左界也一定固定在 R0​）。 在 (3.) 最大值在左邊、最小值在右邊的時候，我們也可以得出類似的性質： 隨著 ℓ 往 L0​ 移動，合法的 r 的 右界 一定也只會 往 R1​ 靠近 。 但注意到 r 如果取太小的話，最小值可能就會跑到左邊去了，也就是說此時我們也會需要維護 r 的 左界 ： 隨著 ℓ 往 L0​ 移動，minℓ,L1​​ 會越來越小，所以 r 的 左界 也要 往右移動 到 minR0​,r​ 足夠小的位置。 實際上，可以觀察到 (3.) 裡 r 的左界其實就是滿足 minR0​,r​<minℓ,L1​​ 的最小的 r（記 r3​），而又 (1.) 裡的右界就是滿足 minR0​,r​>minℓ,L1​​ 最大的 r（記 r1​）： r1​,r3​ 必定滿足 r1​+1=r3​。 於是我們可以在移動 ℓ 時同時維護 r1​ 跟 r3​，將 (1.) 跟 (3.) 的 case 合併處理。 回到原本關鍵的問題：要怎麼將所有 (ℓ,r) pair（1≤ℓ≤r≤n）分進一些沒有交集的 (L0​,L1​,R0​,R1​) 裡面？ 俗話說：「有兩個 index 就很欠分治」，就來嘗試看看吧！ 可以從 Lab 2 Problem B (happily) 的做法得到靈感： 每次將區間 [L,R] 分成兩半 [L,M] 跟 [M+1,R] 遞迴處理，這樣 如果 (ℓ,r) 都落在左半邊或右半邊就會被遞迴處理到。 如果 ℓ 落在左半邊、r 落在右半邊，就會被當下的函式處理到。 int solve(int L, int R) { int M = (L + R) >> 1; int L0 = L, L1 = M, R0 = M+1, R1 = R; int ans = 0; /* calculate answer */ return solve(L, M) + solve(M+1, R) + ans;
} 這也解釋了為什麼上面會說「先忽略 (L1​,R0​) 範圍的東西」，因為 L1​+1=R0​，這個範圍根本就沒有東西啊！ 至此，我們已經有了一個 T(n)=2⋅T(n/2)+O(nlogn)⟹T(n)=O(nlog2n) 的做法了！ Sample Code for Subtask 1, 3, 4: O(nlog2n) #include <bits/stdc++.h>
using namespace std; int main() { ios_base::sync_with_stdio(0), cin.tie(0); int N, K; cin >> N >> K; vector<int> A(N); for (int &x : A) cin >> x; int64_t ans = (K == 0 ? N : 0); function<void(int, int)> recur = [&](int L, int R) { if (L == R) return; int M = (L + R) >> 1; recur(L, M), recur(M+1, R); static vector<int> mn(N), mx(N); static map<int, int> cnt1, cnt2; mn[M] = mx[M] = A[M]; for (int i = M-1; i >= L; --i) mn[i] = min(mn[i+1], A[i]), mx[i] = max(mx[i+1], A[i]); mn[M+1] = mx[M+1] = A[M+1]; for (int i = M+2; i <= R; ++i) mn[i] = min(mn[i-1], A[i]), mx[i] = max(mx[i-1], A[i]); for (int l = M, r1 = M, r2 = M; l >= L; --l) { /// r1: last pos which mn[r1] and mx[r1] is between mn[l] and mx[l] /// /// r1: [max - min - r + l = k] ==> [r = l - k + max - min] /// while (r1 < R and mn[r1+1] > mn[l] and mx[r1+1] < mx[l]) { ++r1; ++cnt1[r1]; --cnt2[r1 + mn[r1]]; } /// r2: last pos which mx[r2] is below mx[l] /// /// r2: [max - min - r + l = k] ==> [r + min = l - k + max] /// while (r2 < R and mx[r2+1] < mx[l]) { ++r2; ++cnt2[r2 + mn[r2]]; } ans += cnt1[l - K + mx[l] - mn[l]]; ans += cnt2[l - K + mx[l]]; } cnt1.clear(), cnt2.clear(); for (int l1 = M+1, l2 = M+1, r = M+1; r <= R; ++r) { /// l1: first pos which mn[l1] and mx[l1] is between mn[r] and mx[r] /// /// l1: [max - min - r + l = k] ==> [l = r + k + min - max] /// while (l1 > L and mn[l1-1] > mn[r] and mx[l1-1] < mx[r]) { --l1; ++cnt1[l1]; --cnt2[l1 - mn[l1]]; } /// l2: first pos which mx[l2] is below mx[r] /// /// l2: [max - min - r + l = k] ==> [l - min = r + k - max] /// while (l2 > L and mx[l2-1] < mx[r]) { --l2; ++cnt2[l2 - mn[l2]]; } ans += cnt1[r + K + mn[r] - mx[r]]; ans += cnt2[r + K - mx[r]]; } cnt1.clear(), cnt2.clear(); }; recur(0, N-1); cout << ans << "\n"; return 0;
} 或許你有這樣的想法：「把 std::map 換成 std::unordered_map 就直接是 O(nlogn) 了耶，一定會跑比較快吧！」，但其實 std::unordered_map 的 常數非常大 ，往往跑的比 std::map 還要更慢。

