好吧，我們終究得面對 maxℓ,L1​​=maxR0​,r​ 的情況。 Or, do we? 對於任意相同的兩個數字 ai​,aj​，我們其實只需要把位置小的 在比較時 看成是 小一點點 的數字，就可以讓任兩個數字都不會被當成相同的值了！ 請試著想想看為什麼上面的計算不會爛掉。 更直接的，我們可以先將 a 以 (ai​,i) 重新編號 變成 a′，把 a′ 當成是 1,2,…,n 的排列，這樣就可以直接套用上面的做法了！ 請仔細觀察下面 rk[] 的使用方式，mn[] 跟 mx[] 分別代表了什麼，以及思考為什麼在計算答案時要套上 A[]。 Sample Code for Subtask 1 ~ 5: O(nlog2n) #include <bits/stdc++.h>
using namespace std; int main() { ios_base::sync_with_stdio(0), cin.tie(0); int N, K; cin >> N >> K; vector<int> A(N); for (int &x : A) cin >> x; vector<pair<int, int>> A_sorted; vector<int> rk(N); for (int i = 0; i < N; ++i) A_sorted.emplace_back(A[i], i); sort(begin(A_sorted), end(A_sorted)); for (int i = 0; i < N; ++i) rk[i] = lower_bound(begin(A_sorted), end(A_sorted), pair{A[i], i}) - begin(A_sorted); sort(begin(A), end(A)); /// use A[rk[i]] to find original A[i] int64_t ans = (K == 0 ? N : 0); function<void(int, int)> recur = [&](int L, int R) { if (L == R) return; int M = (L + R) >> 1; recur(L, M), recur(M+1, R); static vector<int> mn(N), mx(N); static map<int, int> cnt1, cnt2; mn[M] = mx[M] = rk[M]; for (int i = M-1; i >= L; --i) mn[i] = min(mn[i+1], rk[i]), mx[i] = max(mx[i+1], rk[i]); mn[M+1] = mx[M+1] = rk[M+1]; for (int i = M+2; i <= R; ++i) mn[i] = min(mn[i-1], rk[i]), mx[i] = max(mx[i-1], rk[i]); for (int l = M, r1 = M, r2 = M; l >= L; --l) { /// r1: last pos which mn[r1] and mx[r1] is between mn[l] and mx[l] /// /// r1: [max - min - r + l = k] ==> [r = l - k + max - min] /// while (r1 < R and mn[r1+1] > mn[l] and mx[r1+1] < mx[l]) { ++r1; ++cnt1[r1]; --cnt2[r1 + A[mn[r1]]]; } /// r2: last pos which mx[r2] is below mx[l] /// /// r2: [max - min - r + l = k] ==> [r + min = l - k + max] /// while (r2 < R and mx[r2+1] < mx[l]) { ++r2; ++cnt2[r2 + A[mn[r2]]]; } ans += cnt1[l - K + A[mx[l]] - A[mn[l]]]; ans += cnt2[l - K + A[mx[l]]]; } cnt1.clear(), cnt2.clear(); for (int l1 = M+1, l2 = M+1, r = M+1; r <= R; ++r) { /// l1: first pos which mn[l1] and mx[l1] is between mn[r] and mx[r] /// /// l1: [max - min - r + l = k] ==> [l = r + k + min - max] /// while (l1 > L and mn[l1-1] > mn[r] and mx[l1-1] < mx[r]) { --l1; ++cnt1[l1]; --cnt2[l1 - A[mn[l1]]]; } /// l2: first pos which mx[l2] is below mx[r] /// /// l2: [max - min - r + l = k] ==> [l - min = r + k - max] /// while (l2 > L and mx[l2-1] < mx[r]) { --l2; ++cnt2[l2 - A[mn[l2]]]; } ans += cnt1[r + K + A[mn[r]] - A[mx[r]]]; ans += cnt2[r + K - A[mx[r]]]; } cnt1.clear(), cnt2.clear(); }; recur(0, N-1); cout << ans << "\n"; return 0;
}

