191.body:
Imagine you want to find all intervals where the left boundary ℓ is in [L0​,L1​] and the right boundary r is in [R0​,R1​] for all non-overlapping intervals [L0​,L1​] and [R0​,R1​]: If the equation becomes r−ℓ=k, how can you solve it in O(R1​−L0​) time? Approach It's simple, iterate over ℓ∈[L0​,L1​] and check if ℓ+k falls in [R0​,R1​]. If the equation becomes maxℓ,L1​​−(r−ℓ)=k, what can you do? Approach Separate the expression involving ℓ and r to obtain maxℓ,L1​​+ℓ−k=r For a given ℓ∈[L0​,L1​], define costL​(ℓ)=maxℓ,L1​​+ℓ. There is a solution if costL​(ℓ)−k falls in [R0​,R1​]. The value of costL​(ℓ) can be maintained in O(1) time by keeping track of the maximum value of a from L1​ backward. Sample Code int solve(int L0, int L1, int R0, int R1) { int ans = 0; for (int l = L1, mx = a[L1]; l >= L0; --l) { mx = max(mx, a[l]); if (R0 <= mx + l - k and mx + l - k <= R1) ++ans; } return ans;
} If the equation becomes (maxℓ,L1​​−minR0​,r​)−(r−ℓ)=k, how can you solve it? Approach Similarly, rearrange the equation to maxℓ,L1​​+ℓ−k=minR0​,r​+r Even though the right side is no longer an interval, we can calculate all valid right boundaries costR​(r):=minR0​,r​+r first. Then, iterate over ℓ to find the solution. Note that costR​ may contain duplicates (e.g., [4,2,3,1] with costR​(1)=costR​(3)=costR​(4)=5), so we need to calculate the contribution of these right boundaries multiple times . The following implementation uses std::map to record all numbers and their occurrences in costR​. While traversing ℓ from L1​ to L0​, we can directly calculate the answer. Sample Code int solve(int L0, int L1, int R0, int R1) { int ans = 0; map<int, int> costR; for (int r = R0, mn = a[R0]; r <= R1; ++r) { mn = min(mn, a[r]); ++costR[mn + r]; } for (int l = L1, mx = a[L1]; l >= L0; --l) { mx = max(mx, a[l]); ans += costR[mx + l - k]; } return ans;
} If the equation becomes max(maxℓ,L1​​,maxR0​,r​)−(r−ℓ)=k, what can you do? Approach Similarly, rearrange the equation... Hmm? It seems like it can't be rearranged, huh? QwQ Can we try to discuss separately the possible cases that might arise? maxℓ,L1​​>maxR0​,r​: The maximum value is in [ℓ,L1​]; maxℓ,L1​​<maxR0​,r​: The maximum value is in [R0​,r]; maxℓ,L1​​=maxR0​,r​: Both sides have the maximum value!? Maybe let's first consider a is a permutation of 1,2,…,n... (1.) and (2.) are essentially the same, just with left and right swapped. The explanation below focuses on (1.). If we want the maximum value to appear in [ℓ,L1​], it means that at this time, r should not be too large , or else we may include a number greater than maxℓ,L1​​ in the right half. But how can we quickly maintain different ranges for r as ℓ moves left? Considering that when you move ℓ one step to the left, maxℓ−1,L1​​=max(aℓ−1​,maxℓ,L1​​) will definitely only increase. Therefore, as ℓ moves towards L0​, the right boundary of valid r will only move closer to R1​ (the left boundary will always be fixed at R0​). Thus, we can use a two-pointer approach to maintain: use two variables to record the current left and right boundaries (ℓ,r) and use a while loop to check where r can move to each time ℓ moves. Now that we know the maximum value is in [ℓ,L1​], we can rearrange the equation into the same form as the second hint: maxℓ,L1​​+ℓ−k=r Refer to the code for the remaining implementation. Sample Code int solve(int L0, int L1, int R0, int R1) { int ans = 0; for (int l = L1, r = R0-1, mx = a[L1]; l >= L0; --l) { mx = max(mx, a[l]); while (r < R1 and a[r+1] < mx) ++r; if (R0 <= mx + l - k and mx + l - k <= r) ++ans; } for (int l = L1+1, r = R0, mx = a[R0]; r <= R1; ++r) { mx = max(mx, a[r]); while (l > L0 and a[l-1] < mx) --l; if (l <= -mx + r + k and -mx + r + k <= L1) ++ans; } return ans;
} If the equation returns to its original form, what can you do? Approach First, ignore the range (L1​,R0​). In other words, we want to find all (ℓ,r) pairs such that (max(maxℓ,L1​​,maxR0​,r​)−min(minℓ,L1​​,minR0​,r​))−(r−ℓ)=k Continue to split the cases: maxℓ,L1​​>maxR0​,r​ and minℓ,L1​​<minR0​,r​: Both maximum and minimum values are in [ℓ,L1​]; maxℓ,L1​​<maxR0​,r​ and minℓ,L1​​>minR0​,r​: Both maximum and minimum values are in [R0​,r]; maxℓ,L1​​>maxR0​,r​ and minℓ,L1​​>minR0​,r​: Maximum value is on the left, minimum value is on the right; maxℓ,L1​​<maxR0​,r​ and minℓ,L1​​<minR0​,r​: Maximum value is on the right, minimum value is on the left. Due to symmetry, the analysis below only discusses cases (1.) and (3.): In case (1.) where both maximum and minimum values are in [ℓ,L1​], we can obtain a similar property as in the previous hint: As ℓ moves towards L0​, the right boundary of valid r will only move closer to R1​ (the left boundary will always be fixed at R0​). In case (3.) where the maximum value is on the left and the minimum value is on the right, we can also deduce a similar property: As ℓ moves towards L0​, the right boundary of valid r will only move closer to R1​ . However, note that if r becomes too small, the minimum value may end up on the left. Therefore, we also need to maintain the left boundary of r as ℓ moves towards L0​: As ℓ moves towards L0​, minℓ,L1​​ will become smaller, so the left boundary of r must also move to the right to a small enough position relative to minR0​,r​. In practice, it can be observed that in case (3.), the left boundary of r is actually the smallest r that satisfies minR0​,r​<minℓ,L1​​ (denoted as r3​), and in case (1.), the right boundary is the largest r that satisfies minR0​,r​>minℓ,L1​​ (denoted as r1​): r1​,r3​ must satisfy r1​+1=r3​. Therefore, we can maintain r1​ and r3​ simultaneously while moving ℓ, and reset them to r1​=r3​ after finishing Case 1 and Case 3. During the movement, decrement cnt1[] and cnt2[] in reverse order. Think about why we need to move r2 before moving r1. Now we have a solution with T(n)=2⋅T(n/2)+O(nlogn)⟹T(n)=O(nlog2n)! Sample Code for Subtask 1, 3, 4: O(nlog2n) #include <bits/stdc++.h>
using namespace std; int main() { ios_base::sync_with_stdio(0), cin.tie(0); int N, K; cin >> N >> K; vector<int> A(N); for (int &x : A) cin >> x; int64_t ans = (K == 0 ? N : 0); function<void(int, int)> recur = [&](int L, int R) { if (L == R) return; int M = (L + R) >> 1; recur(L, M), recur(M+1, R); static vector<int> mn(N), mx(N); static map<int, int> cnt1, cnt2; mn[M] = mx[M] = A[M]; for (int i = M-1; i >= L; --i) mn[i] = min(mn[i+1], A[i]), mx[i] = max(mx[i+1], A[i]); mn[M+1] = mx[M+1] = A[M+1]; for (int i = M+2; i <= R; ++i) mn[i] = min(mn[i-1], A[i]), mx[i] = max(mx[i-1], A[i]); for (int l = M, r1 = M, r2 = M; l >= L; --l) { /// r1: last pos which mn[r1] and mx[r1] is between mn[l] and mx[l] /// /// r1: [max - min - r + l = k] ==> [r = l - k + max - min] /// while (r1 < R and mn[r1+1] > mn[l] and mx[r1+1] < mx[l]) { ++r1; ++cnt1[r1]; --cnt2[r1 + mn[r1]]; } /// r2: last pos which mx[r2] is below mx[l] /// /// r2: [max - min - r + l = k] ==> [r + min = l - k + max] /// while (r2 < R and mx[r2+1] < mx[l]) { ++r2; ++cnt2[r2 + mn[r2]]; } ans += cnt1[l - K + mx[l] - mn[l]]; ans += cnt2[l - K + mx[l]]; } cnt1.clear(), cnt2.clear(); for (int l1 = M+1, l2 = M+1, r = M+1; r <= R; ++r) { /// l1: first pos which mn[l1] and mx[l1] is between mn[r] and mx[r] /// /// l1: [max - min - r + l = k] ==> [l = r + k + min - max] /// while (l1 > L and mn[l1-1] > mn[r] and mx[l1-1] < mx[r]) { --l1; ++cnt1[l1]; --cnt2[l1 - mn[l1]]; } /// l2: first pos which mx[l2] is below mx[r] /// /// l2: [max - min - r + l = k] ==> [l - min = r + k - max] /// while (l2 > L and mx[l2-1] < mx[r]) { --l2; ++cnt2[l2 - mn[l2]]; } ans += cnt1[r + K + mn[r] - mx[r]]; ans += cnt2[r + K - mx[r]]; } cnt1.clear(), cnt2.clear(); }; recur(0, N-1); cout << ans << "\n"; return 0;
} You might think, "Replacing std::map with std::unordered_map would make it O(nlogn), and it should be faster, right?" However, in practice, the constant factor for std::unordered_map is often larger than that for std::map, making it slower.

