考慮 q≤3000，每次詢問採取 O(n) 的複雜度是被允許的。 當你面對（剛好打不過）某個怪物，但等級比他低的怪物都打得過時，優先打等級最大或是最小的怪物會是最佳解？ 當打怪升級到可以挑戰新的一批怪物時，要怎麼維護好目前還沒打的低等級怪物，又同時顧及新的一批怪物？ 從初始狀態開始考慮，先把排序後的怪物分成打得過跟打不過兩區 [ℓ1​,r1​],[ℓ2​,r2​]。嘗試用簡易的資料結構維護當前打得過的怪物 [ℓ1​,r1​]，並且可以優先取得當前最適合挑戰的怪物（打得過的等級最高的怪物）。你會發現用 stack 可以達成這個效果，只要放怪物進去的順序有按照最優解的策略，則可以保證拿出來的怪物也會是當前最佳挑戰的怪物。 Sample Code #include <bits/stdc++.h>
using namespace std; using int64 = long long; const int64 INF = 1E16; int main() { ios_base::sync_with_stdio(0), cin.tie(0); int N, Q; cin >> N >> Q; vector<int64> V(N), pre; for (int64 &x : V) cin >> x; V.emplace_back(INF); sort(begin(V), end(V)); for (int q = 1; q <= Q; ++q) { int64 X, Y; cin >> X >> Y; stack<int> alive; int cnt = 0; for (int i = 0; i <= N and X < Y; ++i) { while (alive.size() and X < min(V[i], Y)) X += alive.top(), alive.pop(), ++cnt; if (X < min(V[i], Y)) { cnt = -1; break; } alive.emplace(V[i]); } cout << cnt << "\n"; } return 0;
