We can have code like the following: // [lo, hi] is used to maintain the range of possible slopes
int lo = -1'000'000'000, hi = 1'000'000'000, mi; // If we can't squeeze the answer within [m, m], keep squeezing!
while (lo != hi) { mi = lo + (hi - lo) / 2; auto [x, y] = query(mi); if (x == k) return y; if (x < k) hi = mi; else lo = mi + 1;
} // lo should be the tangent slope at (k, y[k])
auto [x, y] = query(lo);
return y; The worst-case number of queries is ⌈log2​(109−(−109))⌉+1=32 times. It's important to note that when the same tangent line touches multiple points, it returns the farthest left point. So, if the point k you're looking for is to the right of the point x you found, these two points might have the same slope. In this case, when narrowing down the range of slopes, we should keep this possibility, which is why we use hi = mi instead of hi = mi - 1. Conversely, if point k is to the left of point x, these two points definitely have different slopes, and that's why we use lo = mi + 1 instead of lo = mi. When implementing binary search, you have to be careful that the loop can reach the termination condition without falling into an infinite loop. Here are some possible reasons for such a situation: Using both lo = mi, hi = mi: In this problem, although you could use lo = mi (still covering the answer), doing so could potentially cause the binary search to keep running when close to boundary conditions. Suppose the current range of slopes in the binary search is [lo, lo + 1], and lo is not the tangent slope of point k. Then, using the slope mi = lo will query a point to the left of point k. Triggering the lo = mi condition keeps the search range as [lo, lo + 1]. If you correctly use lo = mi + 1, the search range would become [lo + 1, lo + 1], meeting the termination condition. Choosing the wrong midpoint: For the interval [lo, hi], there are at most two midpoints you can choose: mi=⌊(lo+hi)/2⌋ mi=⌈(lo+hi)/2⌉ When using mi=⌊(lo+hi)/2⌋, if the formula inside the binary search for reducing the range is lo = mi, hi = mi - 1, and the search range is [lo, lo + 1], the occurrence of the lo = mi case keeps the range as [lo, lo + 1], falling into an infinite loop. When using mi=⌈(lo+hi)/2⌉, if the formula inside the binary search for reducing the range is lo = mi + 1, hi = mi, and the search range is [lo, lo + 1], the occurrence of the hi = mi case keeps the range as [lo, lo + 1], falling into an infinite loop. This problem belongs to the lo = mi + 1, hi = mi case, so what would be the issue with using the formula mi = (lo + hi) / 2 for calculating the midpoint? It's important to note that in C++ integer operations, a negative number n divided by 2 would result in ⌈2n​⌉ (e.g., (-15) / 2 = -7). So, using mi = (lo + hi) / 2 when lo + hi is an odd negative would lead to an infinite loop. Using the bitwise operation mi = (lo + hi) >> 1 ensures that it always calculates mi=⌊(lo+hi)/2⌋; the bitwise operation mi = (lo + hi + 1) >> 1 ensures that it always calculates mi=⌈(lo+hi)/2⌉. Using mi = lo + (hi - lo) / 2 will also ensure that mi=⌊(lo+hi)/2⌋ if lo≤hi.
